INSERT INTO project VALUES (project_seq.nextVal,75,2,'컴퓨터 관리 어드민 시스템','2024-11-10','시스템 관리자 역할을 위한 플랫폼으로 컴퓨터와 서버의 상태를 실시간으로 모니터링하고 관리하며 효율적인 시스템 운영을 지원합니다.');
INSERT INTO project VALUES (project_seq.nextVal,76,1,'초보자도 쉽게 사용하는 코드 편집기','2024-11-12','코드 작성에 익숙하지 않은 초보자도 쉽게 사용할 수 있도록 직관적이고 간단한 인터페이스를 제공하는 코드 편집기입니다. 초보자가 편리하게 코딩을 시작할 수 있게 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,77,9,'최적화 알고리즘 시뮬레이터','2024-11-27','최적화 알고리즘을 실시간으로 시뮬레이션하고 다양한 문제를 해결하는 데 사용할 수 있는 도구입니다. 사용자는 최적화 문제를 실험하고 최적의 해결책을 찾을 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,78,8,'SQL 쿼리 도우미 AI','2024-11-29','SQL 쿼리 작성 시 자동으로 최적화와 제안을 제공하는 AI 도구로 쿼리 성능을 개선하고 효율적으로 쿼리를 작성할 수 있게 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,79,4,'재미있는 코딩 퀴즈 앱','2024-12-08','코딩 퀴즈를 통해 개발자들이 재미있게 문제를 풀고 실력을 향상시킬 수 있는 앱입니다. 다양한 난이도의 문제를 제공하여 학습을 즐겁게 만듭니다.');
INSERT INTO project VALUES (project_seq.nextVal,80,3,'꿈 분석 데이터 시각화 앱','2024-12-28','꿈의 내용을 분석하여 데이터를 시각화하는 앱으로 사용자가 꿈에 대해 다양한 패턴을 이해하고 분석할 수 있도록 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,81,1,'코딩 학습자를 위한 천국 같은 플랫폼','2024-07-03','코딩 학습을 위한 완벽한 플랫폼으로 초보자부터 전문가까지 다양한 학습 자료와 도구를 제공하여 효율적이고 즐겁게 학습할 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,82,4,'자바 클래스 구조 시각화 도구','2024-07-03','자바 클래스 구조를 시각적으로 보여주는 도구로 클래스 간 관계와 상속 구조를 쉽게 이해하고 분석할 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,83,1,'배열 데이터 최적화 도구','2024-07-06','배열 데이터를 최적화하여 성능을 개선하는 도구로 비효율적인 배열을 자동으로 분석하고 최적화하여 실행 시간을 단축시킵니다.');
INSERT INTO project VALUES (project_seq.nextVal,84,8,'코드 완성 추천 시스템','2024-07-10','코드 작성 중 자동으로 완성 추천을 제공하는 시스템으로 개발자는 빠르고 정확하게 코드를 작성할 수 있습니다. 코드 작성 속도를 높이는 데 도움이 됩니다.');
INSERT INTO project VALUES (project_seq.nextVal,85,6,'버그 히스토리 관리 앱','2024-08-06','발생한 버그의 히스토리를 관리하고 추적하는 앱으로 버그 수정 과정을 기록하고 팀원과 협업하여 효율적으로 문제를 해결할 수 있게 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,86,7,'코딩 문법 검사 도구','2024-08-13','코딩 문법을 자동으로 검사하고 오류를 실시간으로 찾아내어 코드 품질을 높이는 도구입니다. 문법 오류를 빠르게 수정할 수 있도록 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,87,5,'빠른 코드 배포 자동화 시스템','2024-08-27','코드 배포 과정을 자동화하여 개발자는 빠르고 안정적으로 최신 코드를 배포할 수 있도록 돕는 시스템입니다. 빌드 테스트 배포 단계를 자동화하여 개발 생산성을 높입니다.');
INSERT INTO project VALUES (project_seq.nextVal,88,4,'에러 원인 추적 AI 도구','2024-09-03','코드에서 발생한 에러의 원인을 빠르게 추적하여 문제를 해결할 수 있도록 돕는 AI 도구입니다. 에러 발생 패턴을 분석하고 가능한 원인과 해결 방법을 자동으로 제시합니다.');
INSERT INTO project VALUES (project_seq.nextVal,89,2,'개발자를 위한 소셜 네트워크 플랫폼','2024-09-05','개발자들이 정보를 공유하고 협업할 수 있는 소셜 네트워크 플랫폼입니다. 프로젝트 관리 코드 리뷰 문제 해결 등을 통해 개발자들 간의 유대감을 형성하고 지식을 교류할 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,90,1,'이진수 계산 학습 게임','2024-10-06','이진수 계산을 재미있게 배우고 연습할 수 있는 게임입니다. 사용자는 다양한 난이도의 문제를 풀면서 이진수 개념을 자연스럽게 익힐 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,91,8,'비트 연산 시뮬레이터','2024-10-06','비트 연산의 다양한 연산을 시뮬레이션하는 도구로 비트 연산을 실시간으로 시각화하여 사용자에게 이해를 돕고 연습할 수 있는 환경을 제공합니다.');
INSERT INTO project VALUES (project_seq.nextVal,92,10,'네트워크 상태 분석 도구','2024-10-13','네트워크 상태를 실시간으로 모니터링하고 네트워크 성능 속도 지연 시간 등을 분석하여 문제를 신속하게 진단할 수 있도록 돕는 도구입니다.');
INSERT INTO project VALUES (project_seq.nextVal,93,9,'취약점 모의 해킹 플랫폼','2024-10-22','취약점 분석과 해킹을 시뮬레이션하여 시스템의 보안을 강화할 수 있는 플랫폼입니다. 모의 해킹을 통해 보안 취약점을 찾아내고 이를 개선할 수 있도록 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,94,3,'링크드리스트 구조 시뮬레이터','2024-10-22','링크드 리스트 구조를 시뮬레이션하여 삽입 삭제 탐색 등의 기본 연산을 시각적으로 보여주며 학습자가 구조의 작동 원리를 쉽게 이해할 수 있도록 돕습니다.');
INSERT INTO project VALUES (project_seq.nextVal,95,3,'스택 기반 게임 엔진','2024-10-29','스택 기반의 게임 엔진으로 스택 자료구조를 활용한 다양한 게임을 만들 수 있는 플랫폼입니다. 게임 로직 구현에 스택을 이용하여 창의적인 게임을 개발할 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,96,8,'시각적 SQL 쿼리 빌더','2024-11-02','SQL 쿼리를 시각적으로 작성하고 실행할 수 있도록 돕는 도구입니다. 사용자는 복잡한 SQL 쿼리를 드래그 앤 드롭 방식으로 쉽게 작성하고 수정할 수 있습니다.');
INSERT INTO project VALUES (project_seq.nextVal,97,7,'트랜잭션 기록 및 복구 도구','2024-11-11','트랜잭션 기록과 복구 기능을 제공하여 시스템 장애나 오류 발생 시 데이터 일관성을 유지하고 안전하게 복구할 수 있는 도구입니다.');
INSERT INTO project VALUES (project_seq.nextVal,98,4,'코딩 트렌드 추천 시스템','2024-11-12','최신 코딩 트렌드를 분석하고 개발자가 사용할 수 있는 트렌드 정보를 추천하는 시스템입니다. 언어 라이브러리 도구 등 최신 트렌드를 실시간으로 업데이트합니다.');
INSERT INTO project VALUES (project_seq.nextVal,99,8,'다국어 문법 검사 및 추천 도구','2024-11-29','다국어 지원 문법 검사 및 추천 도구로 다양한 프로그래밍 언어의 문법 오류를 실시간으로 체크하고 수정 사항을 제시하여 글로벌 개발 환경에서 유용합니다.');
INSERT INTO project VALUES (project_seq.nextVal,100,10,'텍스트 스타일링 자동화 도구','2024-12-24','텍스트 스타일링을 자동으로 최적화하는 도구로 코드나 문서의 스타일을 자동으로 적용하여 일관된 형식을 유지하고 효율적인 작성이 가능합니다.');
