INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,27,9,'강의 내용이 잘 정리되어 있고, 실습을 통해 쉽게 이해할 수 있었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,28,8,'질문에 성실히 답해주셨고, 실무적인 팁을 많이 얻을 수 있었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,29,10,'SQL의 기초부터 심화까지 완벽하게 설명해주셔서 매우 유익했습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,30,7,'수업은 좋았지만, 실습 시간이 부족해서 아쉬웠습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,31,9,'간단한 예제를 통해 개념을 쉽게 익힐 수 있었습니다. 추천합니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,32,6,'수업 속도가 조금 빨라서 따라가는데 힘들었지만 유익한 내용이었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,33,8,'실습 위주로 진행되어 도움이 되었으나, 설명이 조금 더 자세했으면 좋겠습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,34,9,'쌤의 설명이 명확하고, 실습에서 많은 도움을 받았습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,35,8,'CSS를 처음 배웠지만 쉽게 접근할 수 있는 수업이었어요.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,36,10,'HTML의 기본 개념을 정확히 익힐 수 있었고, 실습도 충분히 제공되었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,37,9,'강의가 직관적이고 실용적이어서 쉽게 따라갈 수 있었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,38,8,'수업이 조금 지루했지만, 실습이 많아 도움이 되었습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,39,7,'수업 내용은 좋았지만 템포가 빨라서 따라가는데 어려웠습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,40,10,'실습 위주로 진행되어 바로 적용할 수 있어 매우 유익했습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,41,6,'개념을 잘 설명해주셨지만, 예시가 부족해서 이해하는 데 시간이 걸렸습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,42,9,'각 파트마다 중요한 포인트를 잘 짚어주셔서 좋았습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,43,8,'수업 속도가 적당하고, 질의응답 시간이 충분해 좋았습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,44,7,'자료를 활용한 설명이 조금 부족해서 복습이 필요했습니다.');
INSERT INTO tGrade VALUES (tGrade_seq.nextval,1,45,10,'실습 시간이 많아서 실제 업무에 바로 적용할 수 있는 능력을 키울 수 있었습니다.');
